import React from "react";
import { Select, Space } from "antd";
import "./select.css";

const handleChange = (value) => {
  console.log(`selected ${value}`);
};

const Selectt = () => (
  <Space wrap>
    <Select
      defaultValue="Երևան"
      style={{
        width: 500,
        height: 35,
      }}
      onChange={handleChange}
      options={[
        {
          value: "yerevan",
          label: "Երևան",
        },
        {
          value: "gyumri",
          label: "Գյումրի",
        },
        {
          value: "vanadzor",
          label: "Վանաձոր",
        },
        {
          value: "dilijan",
          label: "Դիլիջան",
        },
        {
          value: "sevan",
          label: "Սևան",
        },
        {
          value: "tsaghkadzor",
          label: "Ծաղկաձոր",
        },
        {
          value: "jermuk",
          label: "Ջերմուկ",
        },
        {
          value: "goris",
          label: "Գորիս",
        },
        {
          value: "kapan",
          label: "Կապան",
        },
        {
          value: "hrazdan",
          label: "Հրազդան",
        },
      ]}
    />
  </Space>
);

const PageTitleSelect = ({ title }) => {
  return (
    <div className="page-title">
      <h1>{title}</h1>
      <div className="select">
        <Selectt />
      </div>
    </div>
  );
};

export { PageTitleSelect };
